(function(jsPDFAPI) {
    var font =
        '';
    var callAddFont = function() {
        this.addFileToVFS('RobotoMono-Regular-normal.ttf', font);
        this.addFont(
            'RobotoMono-Regular-normal.ttf',
            'RobotoMono-Regular',
            'normal'
        );
    };
    jsPDFAPI.events.push(['addFonts', callAddFont]);
})(jsPDF.API);
